import React from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';


const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <div className="top-bar nav">
      <div className='title-bar' data-responsive-toggle='mobile-bar'>

        <div className='title-bar-left' id='mobile-bar'>
          <button className='menu-icon'></button>
          <ul className="menu large-horizontal" data-responsive-menu='drilldown medium-dropdown'>
            <Services />
            <About />
            <Philantrophy />
          </ul>
        </div>

      </div>

      <div className='title-bar-right'>
        <img
          src={logo}
          className="nav-logo small-1 medium-1 large-1"
          alt="Logo"
          onClick={scrollToTop}
        />
      </div>
    </div>
  );
}

export default Navbar;
